import './Header.css';
import react_logo from '../../images/react_logo.png'
import LoginLink from "./LoginLInk/LoginLink";

const Header = () => {

	return (
		<header className='header'>
			<div className="react_logo">
				<img src={ react_logo } alt=""/>
			</div>
			<LoginLink/>
		</header>
	)
}

export default Header;
